Mossberg 500 Tactical Tri-Rail 12 Ga. with 24" Rifled Barrel and Factory Rifle Sights.  Used for four years in 3-Gun competitions across South and Southwest.  Receiver is coated with durable scratch-resistant Rhino-Gun Finish. Barrel and Tube have been refinished in Parkerette Baked-On Finish.  Gun just had a Mossberg tune-up with new ejector, follower, cartridge stop and cartridge interrupter and it shoots very tight like a new gun! Chambers 2 3/4 or 3 inch Shells and holds 5+1.  

You get everything shown in pictures, including: 
Magpul 6-Position Stock/Pistol Grip w/ Large Recoil Pad and 6-Shot Shell Holders; 
Magpul Tri-Rail Forearm w/ some Rail Covers;
Magpul Vertical Grip;
120 Lumen 3 LED Tactical Light on the Barrel Mount; 
3-Point Combat-Carry Sling with M-Tac Silencers on sling clips;
Extra Black Sporter Stock and Forend for Hunting or Skeet;
All Shells shown in Shell Holders.
I will also include a box or two of assorted ammo, and a new 48"x16" VISM (U.S. Made) Tactical Shotgun Case ( http://www.amazon.com/VISM-NcStar-Scope-Ready-Black-CVS2907-48/ ).

REDACTED, voice calls or emai. You can text, but I'll call back on a voice call.  Face to Face ONLY, Cash Only, in Tulsa or Claremore Area.
